export function decompress(e){let t;let n=e.length,f=16,o=[];for(;f<n;){if(255===(t=e[f++])){o.push(e[f++],e[f++],e[f++],e[f++],e[f++],e[f++],e[f++],e[f++]);continue}for(let r=0;r<8&&f<n;r++){if(t&&t<<r&128){o[o.length]=e[f++];continue}let n=e[f++],l=((15&n)<<8|e[f++])+1,u=(n>>4)+2;for(u<3&&(u=e[f++]+18);u--;)o[o.length]=o[o.length-l]}}return Buffer.from(o)}